{
    "singleQuote": true,
    "tabWidth": 4,
    "trailingComma": "es5",
    "printWidth": 80
}

{
  "branches": [
    "master"
  ],
  "plugins": [
    "@semantic-release/commit-analyzer",
    "@semantic-release/release-notes-generator",
    ["@semantic-release/changelog", {
      "changelogFile": "CHANGELOG.md"
    }],
    "@semantic-release/npm", {
      "npmPublish": false,
    },
    ["@semantic-release/git", {
      "assets": ["CHANGELOG.md", "package.json"],
      "message": "chore(release): ${nextRelease.version}\n\n${nextRelease.notes}"
    }],
  ]
}

{
    "extends": "stylelint-config-standard",
    "rules": {
        "indentation": 4,
        "selector-type-no-unknown": [
            true,
            {
                "ignoreTypes": [
                    "/^mat-/"
                ]
            }
        ],
        "selector-pseudo-element-no-unknown": [
            true,
            {
                "ignorePseudoElements": ["ng-deep"]
            }
        ],
        "at-rule-no-unknown": [
            true,
            {
                "ignoreAtRules": ["function", "if", "each", "include", "mixin"]
            }
        ],
        "media-feature-name-no-unknown": [
            true,
            {
              "ignoreMediaFeatureNames": ["display-mode"]
            }
        ],
        "value-keyword-case": null,
        "string-quotes": "single",
        "value-no-vendor-prefix": null,
        "property-no-vendor-prefix": null
    },
    "plugins": ["stylelint-scss"],
    "syntax": "scss"
}

{
    "$schema": "./node_modules/@angular/cli/lib/config/schema.json",
    "cli": {
        "schematicCollections": ["@angular-eslint/schematics"],
        "analytics": false
    },
    "version": 1,
    "newProjectRoot": "projects",
    "projects": {
        "iptvnator": {
            "root": "",
            "sourceRoot": "src",
            "projectType": "application",
            "schematics": {
                "@schematics/angular:application": {
                    "strict": true,
                    "style": "scss"
                }
            },
            "architect": {
                "build": {
                    "builder": "@angular-devkit/build-angular:browser-esbuild",
                    "options": {
                        "outputPath": "dist",
                        "index": "src/index.html",
                        "main": "src/main.ts",
                        "tsConfig": "src/tsconfig.app.json",
                        "polyfills": ["zone.js"],
                        "assets": [
                            "src/favicon.ico",
                            "src/assets",
                            "src/manifest.webmanifest"
                        ],
                        "styles": [
                            "src/m3-theme.scss",
                            "./node_modules/video.js/dist/video-js.css"
                        ],
                        "scripts": [],
                        "serviceWorker": true,
                        "ngswConfigPath": "ngsw-config.json",
                        "webWorkerTsConfig": "tsconfig.worker.json"
                    },
                    "configurations": {
                        "dev": {
                            "optimization": false,
                            "outputHashing": "none",
                            "sourceMap": true,
                            "namedChunks": false,
                            "aot": true,
                            "extractLicenses": true,
                            "vendorChunk": false,
                            "buildOptimizer": true,
                            "fileReplacements": [
                                {
                                    "replace": "src/environments/environment.ts",
                                    "with": "src/environments/environment.dev.ts"
                                }
                            ]
                        },
                        "web": {
                            "optimization": true,
                            "outputHashing": "none",
                            "sourceMap": false,
                            "namedChunks": false,
                            "aot": true,
                            "extractLicenses": true,
                            "vendorChunk": false,
                            "buildOptimizer": true,
                            "fileReplacements": [
                                {
                                    "replace": "src/environments/environment.ts",
                                    "with": "src/environments/environment.web.ts"
                                }
                            ]
                        },
                        "production": {
                            "optimization": false,
                            "outputHashing": "none",
                            "sourceMap": false,
                            "namedChunks": false,
                            "aot": true,
                            "extractLicenses": true,
                            "vendorChunk": false,
                            "buildOptimizer": true,
                            "fileReplacements": [
                                {
                                    "replace": "src/environments/environment.ts",
                                    "with": "src/environments/environment.prod.ts"
                                }
                            ]
                        }
                    }
                },
                "serve": {
                    "builder": "@angular-devkit/build-angular:dev-server",
                    "options": {
                        "buildTarget": "iptvnator:build"
                    },
                    "configurations": {
                        "dev": {
                            "buildTarget": "iptvnator:build:dev"
                        },
                        "web": {
                            "buildTarget": "iptvnator:build:web"
                        },
                        "production": {
                            "buildTarget": "iptvnator:build:production"
                        }
                    }
                },
                "extract-i18n": {
                    "builder": "@angular-devkit/build-angular:extract-i18n",
                    "options": {
                        "buildTarget": "iptvnator:build"
                    }
                },
                "test": {
                    "builder": "@angular-builders/jest:run",
                    "options": {}
                },
                "lint": {
                    "builder": "@angular-eslint/builder:lint",
                    "options": {
                        "lintFilePatterns": ["src/**/*.ts", "src/**/*.html"]
                    }
                }
            }
        },
        "iptvnator-e2e": {
            "root": "e2e",
            "projectType": "application",
            "architect": {
                "lint": {
                    "builder": "@angular-eslint/builder:lint",
                    "options": {
                        "lintFilePatterns": ["e2e/**/*.ts"]
                    }
                }
            }
        }
    },
    "schematics": {
        "@schematics/angular:component": {
            "prefix": "app",
            "style": "scss"
        },
        "@schematics/angular:directive": {
            "prefix": "app"
        }
    }
}

import angularEslintPlugin from '@angular-eslint/eslint-plugin';
import angularEslintTemplate from '@angular-eslint/eslint-plugin-template';
import parser from '@angular-eslint/template-parser';
import { FlatCompat } from '@eslint/eslintrc';
import js from '@eslint/js';
import ngrxEslint from '@ngrx/eslint-plugin';
import typescriptEslint from '@typescript-eslint/eslint-plugin';
import tsParser from '@typescript-eslint/parser';
import globals from 'globals';
import path from 'node:path';
import { fileURLToPath } from 'node:url';

const __filename = fileURLToPath(import.meta.url);
const __dirname = path.dirname(__filename);
const compat = new FlatCompat({
    baseDirectory: __dirname,
    recommendedConfig: js.configs.recommended,
    allConfig: js.configs.all,
});

export default [
    {
        ignores: ['**/*.worker.ts'],
    },
    {
        languageOptions: {
            globals: {
                ...globals.browser,
                ...globals.node,
            },
        },
    },
    ...compat
        .extends(
            'eslint:recommended',
            'plugin:@typescript-eslint/eslint-recommended',
            'plugin:@typescript-eslint/recommended',
            'plugin:@typescript-eslint/recommended-requiring-type-checking'
        )
        .map((config) => ({
            ...config,
            files: ['**/*.ts'],
        })),
    {
        files: ['**/*.ts'],
        plugins: {
            '@typescript-eslint': typescriptEslint,
            '@angular-eslint': angularEslintPlugin,
            '@ngrx/recommended': ngrxEslint,
        },
        languageOptions: {
            parser: tsParser,
            ecmaVersion: 10,
            sourceType: 'module',

            parserOptions: {
                project: [
                    './tsconfig.serve.json',
                    './src/tsconfig.app.json',
                    './src/tsconfig.spec.json',
                    './e2e/tsconfig.e2e.json',
                ],

                ecmaFeatures: {
                    modules: true,
                },
            },
        },
        rules: {
            '@typescript-eslint/indent': 0,
            'no-unused-vars': 'off',
            '@typescript-eslint/no-unused-vars': ['error'],
            '@typescript-eslint/no-empty-function': 0,
            '@typescript-eslint/no-unsafe-argument': 0,
            '@typescript-eslint/no-var-requires': 0,
            '@typescript-eslint/no-explicit-any': 0,
            '@typescript-eslint/no-unsafe-call': 0,
            '@typescript-eslint/no-unsafe-member-access': 0,
            '@typescript-eslint/no-unsafe-assignment': 0,
            '@typescript-eslint/no-unsafe-return': 0,
            '@typescript-eslint/no-floating-promises': 0,
            '@typescript-eslint/unbound-method': ['off'],
            '@angular-eslint/use-injectable-provided-in': 'error',
            '@angular-eslint/no-attribute-decorator': 'error',
            '@typescript-eslint/no-require-imports': 'warn',
        },
    },
    {
        files: ['**/*.component.html'],
        plugins: {
            '@angular-eslint/template': angularEslintTemplate,
        },
        languageOptions: {
            parser: parser,
        },
        rules: {
            '@angular-eslint/template/banana-in-box': 'error',
            '@angular-eslint/template/no-negated-async': 'error',
        },
    },
];

{
  "$schema": "./node_modules/@angular/service-worker/config/schema.json",
  "index": "/index.html",
  "assetGroups": [
    {
      "name": "app",
      "installMode": "prefetch",
      "resources": {
        "files": [
          "/favicon.ico",
          "/index.html",
          "/manifest.webmanifest",
          "/*.css",
          "/*.js"
        ]
      }
    },
    {
      "name": "assets",
      "installMode": "lazy",
      "updateMode": "prefetch",
      "resources": {
        "files": [
          "/assets/**",
          "/*.(svg|cur|jpg|jpeg|png|apng|webp|avif|gif|otf|ttf|woff|woff2)"
        ]
      }
    }
  ]
}

import { defineConfig, devices } from '@playwright/test';

export default defineConfig({
    testDir: './e2e',
    timeout: 45000,
    maxFailures: 2,
    testMatch: /.*\.e2e\.ts/,
    webServer: {
        command: 'npm run serve',
        port: 4200,
        reuseExistingServer: !process.env.CI,
        timeout: 120000,
    },
    use: {
        ...devices['Desktop Chrome'],
        baseURL: 'http://localhost:4200',
        headless: false,
        screenshot: 'only-on-failure',
        testIdAttribute: 'data-test-id',
    },
});

{
    "extends": "./tsconfig.json",
    "compilerOptions": {
        "outDir": "../out-tsc/spec",
        "baseUrl": "./",
        "types": ["jest", "node"],
        "experimentalDecorators": true,
        "emitDecoratorMetadata": true,
        "resolveJsonModule": true
    },
    "files": ["src/polyfills.ts"],
    "include": ["**/*.spec.ts", "**/*.d.ts"]
}

/* To learn more about this file see: https://angular.io/config/tsconfig. */
{
    "extends": "./tsconfig.json",
    "compilerOptions": {
        "outDir": "./out-tsc/worker",
        "lib": ["es2018", "webworker", "dom"],
        "types": []
    },
    "include": ["src/**/*.worker.ts"]
}
